script: |
  super -f tsv -I q10995.sql | sort > q10995.out

vector: true

inputs:
  - name: q10995.sql
    data: |
      pragma pg
      SELECT ALL + 60 + col0 AS col0 FROM tab0 GROUP BY col0, col1 HAVING NOT - ( + col0 ) * - 48 + - 39 + + 45 * col1 = NULL;
  - name: tab0

outputs:
  - name: q10995.out
    data: |
